import React, { Component } from 'react';
import CocktailCard from './CocktailCard';

export default class CocktailsList extends Component {
	listCards() {
		return this.props.cocktails.map(c => <CocktailCard key={c.id} cocktail={c} />);
	}

	render() {
		return <div className="ui cards">{this.listCards()}</div>;
	}
}
